import React from "react";
import { Link } from "react-router-dom";

function NavBar() {
    return (
    <container>
        <Row>
            <Col><Link exact path to="/">Home</Link></Col>
            <Col><Link to="/profile">Profile</Link></Col>
            <Col><Link to="/matches">Matches</Link></Col>
        </Row>
    </container>
    )
}

export default NavBar
